        "url": "http://www.eventfinder.co.nz/venue/viaduct-events-centre-westhaven",
        "description": "Viaduct Events Centre is a stand-alone, multi-purpose events centre on the Halsey Street extension wharf, in Auckland's newest development, Wynyard Quarter. Offering eight separate rooms, the 6000m2 facility can cater for a wide range of events from large scale exhibitions and conferences to intimate cocktail functions and meetings.\r\n\r\nWith spectacular views of the Waitemata Harbour, it is minutes away from some of Auckland's best accommodation and entertainment offerings, as well as the city centre and public transport services.\r\n\r\nThe facility has been designed and built to a five-star environmental standard creating an impressive addition to Auckland's vibrant Viaduct Harbour precinct.\r\n\r\nPart of a large portfolio of venues managed by Auckland Conventions Venues and Events, Viaduct Events Centre is set to become one of Auckland's premier venues. Call now to enquire about booking your event.",
