      "name": "Dancing Salmon Home - Reel Earth Film Fest",
      "description": "Reel Earth International Environmental Film Festival presents:\r\n\r\nDancing Salmon Home by William Doolittle (USA/New Zealand, 2012, 66min)\r\n\r\nA journey of loss and reunification across generations and oceans. The Winnemem Wintu tribe of Northern California journey to New Zealand to meet their long-lost Chinook salmon relatives which have been missing from their river for 65 years. Four days of ceremony beside the Rakaia River, forge enduring bonds with the local Iwi. \r\n\r\nFilm screening supported by Forest & Bird Manawatu.\r\n\r\n+ Against the Current by Laura Honey (NZ, 2012, 25min)\r\n\r\nThe Marlborough Sounds is one of New Zealand’s most unique and remarkable waterways. With the government in favour of growing the aquaculture industry, the small local community has an enormous battle on their hands to protect the future of their home.\r\n\r\n+ Recycle by Lynn Wilton, Canada, 2011, 2min \r\nFilmmaker Q&A\r\nWhat goes around, comes around, in a world where everything is connected.\r\n\r\nTickets \r\n$12 Eventfinda / $10 i-SITE or at the door (from 30min prior, Cash/EFTPOS, no credit)\r\n\r\nReel Earth is an annual international competitive environmental film festival. Operated by an incorporated society, Reel Earth relies on the generous support of sponsors and funding bodies. Principal sponsor Palmerston North City Council. Major sponsors: Massey University, New Zealand Agricultural Greenhouse Gas Research Centre (NZAGRC), Destination Manawatu, Te Manawa Museum, Horizons Regional Council, Ministry for the Environment Freshwater Fund, Palmerston North City Environmental Trust, The Lion Foundation & Creative Communities",
