      "name": "Mission Possible - Fit Lean Strong - For Men!",
      "description": "Busy, tired, no time to exercise?\r\n\r\nWant some inspiration, accountability and a proven programme that gives you the flexibility to fit it all in? \r\n\r\nYour mission should you choose to accept is to get yourself into the best shape of your life!  \r\n\r\nOur mission is to make it easy and achievable for you.  Join our 10 week programme and we will save you time, guide you and keep you on track to see you boost your fitness, energy and vitality.\r\n\r\nStarts 17th June 2013 - Registrations Essential\r\n\r\nJoin Wellbeing Specialist Lauren Parsons and a great group of guys for this 10 week programme including regular team fitness and boxing sessions plus everything you need to get in the best shape of your life. Plus you'll learn how to keep it up for life!\r\n\r\n- Group Sessions 5.30pm - 6.15pm every Tues/Thurs for 10 weeks\r\n- Your own Mission Mapbook and Progress Journal \r\n- Weekly 'Missions' to keep you on track\r\n- Ongoing support and Accountability \r\n- Regular Blokes Nights Out and a Big Finale to Finish!\r\n\r\nPicture yourself 12 weeks from now Fit, Lean, Strong, Full of Energy and Vitality, Standing Tall and Walking Proud.\r\n\r\nHurry - Places are limited and are filling fast!\r\n\r\nIf you can't make the 5.30pm sessions you can still take part by distance in your own time - from anywhere in NZ!\r\n\r\nRegister on our website www.laurenparsons.co.nz/mission_possible and pay by bank transfer.  Choose to fix up for the programme in full in advance or by weekly installment.\r\n\r\nOr you can buy tickets directly here on Eventfinda to reserve your spot.    \r\n\r\nGo on - give it a go, you'll be glad you did! ",
