    {
      "id": 174082,
      "url": "http://www.eventfinder.co.nz/2013/oxy-break/auckland/papatoetoe",
      "url_slug": "2013/oxy-break/auckland/papatoetoe",
      "name": "Oxy Break",
      "description": "If you work in an office environment, you probably have some of these symptoms: Tired? Run down? Sore back? Tight shoulders? Neck cramps? You need an Oxy Break!\r\n\r\nRight now, you are probably only using 20% of your lung capacity when you breathe. You might be wondering, then, if it’s true that I only use 20% of my lung capacity, who cares?\r\n\r\nFirst of all, Oxygen fuels all the systems in your body! 10% of the energy you use every day comes from food. The other 90% comes from oxygen!\r\n\r\nWell, guess what? If the majority of your energy comes from oxygen, and you are only using 20% of your lung capacity, then you will feel 5 times better when you learn to breathe correctly!\r\n\r\nIt really is that simple. By learning some simple breathing exercises, you can increase your physical well-being 5-fold! Just by breathing better, you can have an incredible affect on your health!\r\n\r\nIn order to burn fat, you need oxygen! In order to digest food, you need oxygen! In order to turn your food into energy for your muscles, you need oxygen! And when you learn to take a 6-minute Oxy Break every day, you’ll improve all those bodily functions that need oxygen! Plus, you’ll feel great!\r\n\r\nYou can take a refreshing, invigorating Oxy Break anywhere, standing, sitting, or even lying down! There are no health restrictions!\r\n\r\nUnlike other physical remedies, it doesn’t matter if you’re hurt, or even sick. If you have back or joint injuries, or even serious problems like asthma, MS, arthritis, allergies or other respiratory problems, you can still learn to breathe better!\r\n\r\nAnd regardless of how bad your health is now, by learning how to take several Oxy Breaks per day, you will be lowering the stress on your body, and improving your health!\r\n\r\nHow long is an Oxy Break? 6 minutes. 6 minutes of proper breathing. You can do this anywhere! At your desk, in an airplane, even waiting in line! You don’t need an empty stomach! You don’t need a full stomach! You don’t need a gym, and no equipment of any kind is necessary! You just need to learn how to breathe properly, and do it for 6 minutes a few times per day.\r\n\r\n10 reasons to take Oxy Break:\r\n- Reduce stress \r\n- Improve energy level and alertness \r\n- Strengthen your back and spine \r\n- Strengthen your bones and joints \r\n- Improve your skin tone and blood circulation \r\n- Maximize oxygen consumption \r\n- Optimize digestion and elimination \r\n- Bring your bodyweight into a healthier balance \r\n- Increase your strength and flexibility \r\n- Save time and money \r\n- Anyone, and everyone, can do it!\r\n\r\nHow do I get started? The learning process is easy! 6 hands-on lessons of 45 minutes each. Specify the most convenient time to attend the classes. Time available: 5.00 pm, 6.00 pm and 7.00 pm",
