      "name": "Bikes for Africa + Q&A - Reel Earth Film Fest",
      "description": "Reel Earth International Environmental Film Festival presents:\r\n\r\nBikes for Africa by Richard Sidey (New Zealand, 2012, 68min)\r\nQ&A with Hap Cameron & Mandy Todd\r\n\r\nA bicycle can fundamentally change the lives of rural Africans. Bikes for Africa follows the adventures of Hap Cameron and Mandy Todd who attempt to help implement a self-sustainable bike workshop in rural Namibia with a container load of second hand bikes from Melbourne.\r\n\r\n+ The New Environmentalists:\r\nJohn Antonelli/Tom Dusenbery/ Will Parrinello (USA, 2102, 27min)\r\n\r\nThe New Environmentalists share a common goal – safeguarding the Earth’s natural resources from exploitation and pollution, while fighting for justice in their communities. Featuring inspiring portraits of environmental heroes who have placed themselves in harm’s way to battle intimidating adversaries while building strong grassroots support.\r\n\r\n+ Two Wheels Good by Barry Gene Murphy (Ireland, 2012, 10min)\r\nFour inspiring veterans of the open road celebrate life in the saddle.\r\n\r\nTickets \r\n$12 Eventfinda / $10 i-SITE or at the door (from 30min prior, Cash/EFTPOS, no credit)\r\n\r\nReel Earth is an annual international competitive environmental film festival. Operated by an incorporated society, Reel Earth relies on the generous support of sponsors and funding bodies. Principal sponsor Palmerston North City Council. Major sponsors: Massey University, New Zealand Agricultural Greenhouse Gas Research Centre (NZAGRC), Destination Manawatu, Te Manawa Museum, Horizons Regional Council, Ministry for the Environment Freshwater Fund, Palmerston North City Environmental Trust, The Lion Foundation & Creative Communities",
