      "name": "Whangarei Locals Month",
      "description": "Sometimes it’s easy to forget what amazing stuff there is in your back yard. \r\n\r\nKingdom of Zion have a fantastic opportunity for Whangarei locals. Come and visit our wonderful big cats – (we have 33!) – lions, tigers, cheetahs and a black leopard – and for one month only you can bring a friend for free!\r\n\r\nThis applies to our guided tours - 11.00 and 12.30 daily and 2pm Mondays and Fridays as well as our Feed tours (see the big cats fed their meat!) on Tuesdays Thursdays and Saturdays at 2pm and Enrichment tours (see the big cats at play) on Wednesdays and Sundays, also at 2pm.\r\n\r\nJust bring a friend or relative and proof that you live the district – a rates or utility bill will do – and introduce others to the fabulous facility that is right on your doorstep!\r\n\r\nCall the Zion office for more information",
