    {
      "id": 176840,
      "url": "http://www.eventfinder.co.nz/2013/motivation-and-leadership-for-managers2/auckland/east-tamaki",
      "url_slug": "2013/motivation-and-leadership-for-managers2/auckland/east-tamaki",
      "name": "Motivation and Leadership for Managers",
      "description": "Motivating and leading your staff can be intimidating prospects for new and experienced managers alike. MIT Business Course Motivation and Leadership for Managers will teach you the theory and practice of leadership and motivation, equipping you with this vital skillset.\r\n\r\nYou’ll be taught by an experienced industry expert, learning what type of leader you are, how to use psychometric testing, leadership and motivation techniques and how to foster an environment that enables staff to lead. You can learn to motivate and lead – and we can teach you.\r\n\r\nOutcomes\r\nAt the end of this MIT Business Course for Corporates, you will:\r\n- Compare and contrast common motivational and leadership theories\r\n- Interpret psychometric analysis to manage common personality types\r\n- Examine environments that encourages leadership qualities\r\n- Relate communication strategies to situations\r\n\r\nTraining Style\r\n- Presented by industry expert\r\n- Real-life case studies\r\n- Introduction to current thinking and practice\r\n- Group discussion and in-class feedback\r\n- Action plans completed in-class\r\n- Post-course exercises\r\n- Post-course follow-up\r\n- In-house option available\r\n- Customisable course content\r\n\r\nCore Content\r\n\r\nMotivational theories and Leadership theories\r\n- The leadership vs. management debate\r\n- The role of leadership in modern organisations\r\n- Motivation theory vs. leadership theory\r\n\r\nWhat type of leader are you?\r\n- Why psychometric assessment can help make you a better leader\r\n- Why psychometric assessment of your team can make them stronger\r\n- Managing personality differences\r\n\r\nCreating an environment that enables staff to lead\r\n- Is it possible to have leaders at all levels in organisations?\r\n- Empowerment techniques\r\n- Tips for supporting staff without taking over\r\n- The future of leadership in organisations\r\n- A review of current motivational techniques used in organisations\r\n\r\nThe importance of communication\r\n- Communication fundamentals\r\n- Analysing communication styles\r\n- Enhancing your ability to communicate messages with a diverse set of people\r\n\r\nThe special introductory offer is available for a short time only.\r\n\r\nPhone 0800 SKILL UP (754 5587) or email businesstraining@manukau.ac.nz",
