        "description": "We have been given a 30 year lease of the once iconic Papatoetoe Fire Station, which is in a prime location on St Georges Street, easily accessible to young people, their families and the wider community.\r\n\r\nManukau has the largest proportion of young people in the country, considerable assets and a richly diverse community that has the potential for a strong economic future. Alongside these attributes are challenges and pressures associated with such a fast growing environment and Youthline’s services operate in response to a community need in the area.\r\n\r\nThe Manukau Youth and Community Development project represents more than a decade of planning and needs analysis and will a allow us to increase our vital services to youth and the community of Manukau. This project will help enrich the local area by enabling community involvement through volunteering opportunities, personal development, support services, training and leadership opportunities.\r\n\r\nWe have the support of our extensive community networks. Youthline has a strong focus on community development, engagement and ownership and without the support of the community and funders this project would not be possible.",
